import { render } from 'react-dom'
import { App } from './App'
import { configureStore } from 'redux'

// action
const increment = () => {
  return {
    type: 'INCREMENT',
  }
}
const decrement = () => {
  return {
    type: 'DECREMENT',
  }
}

//  reducer
const counter = (state = 0, action) => {
  switch (action.type) {
    case 'INCREMENT':
      return state + 1
    case 'DECREMENT':
      return state - 1
  }
}

let store = configureStore(counter)

// console store
store.subscribe(() => console.log(store.getState()))

// dispatch
store.dispatch(increment())

render(<App />, document.getElementById('root'))

if (module.hot) {
  module.hot.accept()
}
